import React from 'react';
import { Navbar } from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav'
import {
  BrowserRouter as Router,
  Route,
  Link
} from "react-router-dom";
import './App.css';

import Footer from './Components/Footer';
import HomePage from './Pages/HomePage';
import AboutPage from './Pages/AboutPage';
import ContactPage from './Pages/ContactPage';
import ProjectPage from './Pages/ProjectPage';

class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      title: 'Jamil Naber',
      headerLinks : [
        {title: 'Home', path: '/' },
        {title: 'About', path: '/about' },
        {title: 'Contact', path: '/contact' }
      ],
      home: {
        title: 'Welcome ',
        subTitle: 'Summarization of my life',
        text: 'Take a look at my projects' 
      },
      about: {
        title: 'About me '
      },
      contact: {
        title: 'Message Me'
      }
    }
  }

  render(){
    return (
        <Router className ="">
          <div className = "containerC">
          <Container className="p-0 main-content" fluid={true} >
            <Navbar style={{backgroundColor: '#6ebfc2'}} className="border-bottom"  expand="lg">
              <Navbar.Brand >Jamil Naber</Navbar.Brand>
              <Navbar.Toggle className="border-0" aria-controls="navbar-toggle"/>
              <Navbar.Collapse id="navbar-toggle">
                <Nav className="ml-auto" >
                  <Link className="nav-link" to="/">Home</Link>
                  <Link className="nav-link" to="/Projects">Projects</Link>
                  <Link className="nav-link" to="/about">About</Link>
                  <Link className="nav-link" to="/contact">Contact</Link>
                </Nav>
              </Navbar.Collapse>
            </Navbar>

            <Route path='/' exact render={() => <HomePage title={this.state.home.title} subTitle={this.state.home.subTitle} text={this.state.home.text}/>} />
            <Route path='/about' render={() => <AboutPage title={this.state.about.title} />} />
            <Route path='/contact' render={() => <ContactPage title={this.state.contact.title} />} />
            <Route path='/Projects' render={() => <ProjectPage />} />
          </Container>
          <Footer/>
          </div>
        </Router>
      );
  }
}

export default App;

